import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { FaShoppingCart, FaUser } from 'react-icons/fa';
import { Link } from 'react-router-dom';  // ✅ Use Link instead of LinkContainer

const Header = () => {
  return (
    <header>
      <Navbar bg="dark" variant="dark" expand="lg" className="custom-navbar" collapseOnSelect>
        <Container>
          <Navbar.Brand as={Link} to='/'>  {/* ✅ Use `as={Link}` for Navbar.Brand */}
            GateKeep
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ms-auto">
              <Nav.Link as={Link} to='/cart'>  {/* ✅ Use `as={Link}` instead of LinkContainer */}
                <FaShoppingCart /> Cart
              </Nav.Link>
              <Nav.Link as={Link} to='/login'>
                <FaUser /> Sign In
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
